import '../style/App.css';
import Header from './Header';
import Mecze from './Mecze';
import Obstawianie from './Obstawianie';
import Footer from './Footer';
import { BrowserRouter as Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path='/UEFA%20Champions%20League' element={<Mecze competition='UEFA%20Champions%20League'/>} />
        <Route path='/English%20Premier%20League' element={<Mecze competition='English%20Premier%20League'/>} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
